<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Contact</title>
</head>
<body>
  <h1>Contacts</h1>
  <ul>
  {% for object in object_list %}
      <li>{{ object.first_name }} {{ object.last_name }}</li>
  {% empty %}
      <li>No contacts yet.</li>
  {% endfor %}
  </ul>

</body>
</html>
